/**
 * String with Ev3 expected pairing pin.
 * @readonly
 */
const iCOBOTPairingPin = '0000';

class iCOBOT {
    /**
     * Construct a MicroBit communication object.
     * @param {Runtime} runtime - the Scratch 3.0 runtime
     * @param {string} extensionId - the id of the extension
     */
    constructor (runtime, extensionId) {

        /**
         * The Scratch 3.0 runtime used to trigger the green flag button.
         * @type {Runtime}
         * @private
         */
        this._runtime = runtime;
        this._runtime.on('PROJECT_STOP_ALL', this.stopAll.bind(this));
        
        this._extensionId = extensionId;

        /**
         * The most recently received value for each sensor.
         * @type {Object.<string, number>}
         * @private
         */        
        this._sensors = {
            ir_front: 0,
            ir_left: 0,
            ir_right: 0,
            ir_bottom_mid: 0,
            ir_bottom_left: 0,
            ir_bottom_right: 0,
            brightness: 0,
            sound: 0,
            temperature: 0,
            humidity: 0,
            discomfortvalue: 0
        };
        
        this._pollingInterval = 150;
        
        this._pollingIntervalID = null;
        

        /**
         * The Bluetooth connection socket for reading/writing peripheral data.
         * @type {BT}
         * @private
         */
        this._bt = null;
        this._runtime.registerPeripheralExtension(extensionId, this);

        this.reset = this.reset.bind(this);
        this._onConnect = this._onConnect.bind(this);
        this._onMessage = this._onMessage.bind(this);
        this._pollValues = this._pollValues.bind(this);
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get brightness () {
        return this._sensors.brightness;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get sound () {
        return this._sensors.sound;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get ir_front () {
        return this._sensors.ir_front;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get ir_left () {
        return this._sensors.ir_left;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get ir_right () {
        return this._sensors.ir_right;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get ir_bottom_mid () {
        return this._sensors.ir_bottom_mid;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get ir_bottom_left () {
        return this._sensors.ir_bottom_left;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get ir_bottom_right () {
        return this._sensors.ir_bottom_right;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get temperature () {
        return this._sensors.temperature;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get humidity () {
        return this._sensors.humidity;
    }

    /**
     * @return {number} - the latest value received for the sensor.
     */
    get discomfortvalue () {
        return this._sensors.discomfortvalue;
    }

    stopAll () {
        this.stopAllMotors();
        this.stopSound();
        this.stopLed();
    }

    stopSound () {
    }

    stopLed () {
    }

    stopAllMotors () {
    }

    /**
     * Called by the runtime when user wants to scan for an i-COBOT peripheral.
     */
    //      
    scan () {
        //   (this._bt)   .
        if (this._bt) {
            this._bt.disconnect();
        }

        //      
        this._bt = new BT(this._runtime, this._extensionId, {
            majorDeviceClass: 0,
            minorDeviceClass: 0
        }, this._onConnect, this.reset, this._onMessage);
    }


    /**
     * Called by the runtime when user wants to connect to a certain peripheral.
     * @param {number} id - the id of the peripheral to connect to.
     */
    connect (id) {
        if (this._bt) {
            this._bt.connectPeripheral(id, iCOBOTPairingPin);
        }
    }

    disconnect () {
        if (this._bt) {
            this._bt.disconnect();
        }

        this.reset();
    }


    //      
    reset () {
        //        
        console.log("Bluetooth connection reset.");
        this._sensors = {
            ir_front: 0,
            ir_left: 0,
            ir_right: 0,
            ir_bottom_mid: 0,
            ir_bottom_left: 0,
            ir_bottom_right: 0,
            brightness: 0,
            sound: 0,
            temperature: 0,
            humidity: 0,
            discomfortvalue: 0
        };

        if (this._pollingIntervalID) {
            window.clearInterval(this._pollingIntervalID);
            this._pollingIntervalID = null;
        }
    }

    /**
     * Called by the runtime to detect whether the iCOBOT peripheral is connected.
     * @return {boolean} - the connected state.
     */
    isConnected () {
        let connected = false;
        if (this._bt) {
            connected = this._bt.isConnected();
        }
        return connected;
    }


    /**
     * Send a message to the peripheral BT socket.
     * @param {Uint8Array} message - the message to send.
     * @param {boolean} [useLimiter=true] - if true, use the rate limiter
     * @return {Promise} - a promise result of the send operation.
     */
    send (message, useLimiter = true) {
        if (!this.isConnected()) return Promise.resolve();

        if (useLimiter) {
            if (!this._rateLimiter.okayToSend()) return Promise.resolve();
        }

        return this._bt.sendMessage({
            message: Base64Util.uint8ArrayToBase64(message),
            encoding: 'base64'
        });
    }


    //    

    /**
     *
     * @private
     */
    _onConnect() {
        this._pollingIntervalID = window.setInterval(this._pollValues, this._pollingInterval);
        //       
    }

    /**
    *
    * @private
    */
    _pollValues () {
        if (!this.isConnected()) {
            window.clearInterval(this._pollingIntervalID);
            return;
        }
    }



    /**
     * 
     * @param {object} params - incoming message parameters
     * @private
     */
    _onMessage (params) {
        const message = params.message;
        const data = new Base64Util.base64ToUint8Array(message);
        //      
        // const int16Array = new Int16Array(data.buffer);

        console.log("Received Bluetooth message:", data);
    }
}

