    digital_rgbled_onoff (args) {
        var port = 9;
        var loc = Cast.toNumber(args.LOCATION);
        var color = Cast.toNumber(args.COLOR);
        var rLED, gLED, bLED;

        switch(color)
        {
            case 0: rLED = gLED = bLED = 0;
                break;
            case 1: rLED = gLED = bLED = 255;
                break;
            case 2: rLED = 255; gLED = bLED = 0;
                break;
            case 3: rLED = 255; gLED = 50; bled = 0;
                break;
            case 4: rLED = bLED = 0; gLED = 255;
                break;
            case 5: rLED = gLED = 0; bLED = 255;
                break;
            case 6: rLED = 0; gLED = bLED = 255;
                break;
            case 7: rLED = bled = 255; bled = 0;
                break;
        }
    }

